description:
Provides a base class for tests based on Microsoft.Extensions.DependencyInjection. Use common Startup.cs patterns like ConfigureServices(...) and Configure(...) to setup your tests.

Commonly used types:
ServiceTests

Example:
[TestClass]
public class DatabaseCleanupBackgroundServiceTests : ServiceTests
{
    protected override void ConfigureServices([NotNull] IServiceCollection services)
    {
        base.ConfigureServices(services);

        // Configure your services here
        // services.AddSingleton<IMyService>();
    }

    protected override void Configure([NotNull] IServiceProvider services, [NotNull] ILoggerFactory loggerFactory)
    {
        base.Configure(services, loggerFactory);

        loggerFactory.AddDebug(services);
    }

    [TestMethod]
    public void CleanupSuggestedFailTest()
    {
        // Use your DI container as you would during runtime
        // IMyService service = this.GetRequiredService<IMyService>();
    }
}

Wrapper for creating xlsx files with DocumentFormat.OpenXml 

usage: 
var excel = new Document(); 

//Get the first sheet 
var sheet1 = excel.GetSheets().First() 
//Change sheet name 
sheet1.Name = "My first sheet"; 

//Write some data 
sheet1.WriteToCell(1, 1, "Test 1"); 

//Create another sheet 
var sheet2 = excel.AddSheet(new Sheet("My second sheet")); 

//Write some data 
sheet2.WriteToCell(1, 1, "Test 2"); 

//Save to file, or stream... 
excel.Save("myFile.xlsx");

